import pic from "./undraw_under_construction_46pa.svg";
import React from "react";

const Dashboard = () => {
  return (
    <div>
      <img src={pic} alt="Under Construction" className="construction"></img>
      <h1 className="constructionMsg"> Under Construction</h1>
    </div>
  );
};
export default Dashboard;
